    let tagInfo (group, element) =
        Dictionary |> Map.tryFind (group, element) |> Option.defaultValue("Unknown tag", UNKNOWN)

    [<Literal>] 
    let PRIVATE_CREATOR_TAG = "Private Creator"

    [<Literal>] 
    let UNKNOWN_TAG = "Unknown tag"

    let getTagName (group, element) =
        let name, vrType = tagInfo(group, element)
        let isEvenGroup, isPrivateCode = even group, element <= 0xFFus

        match vrType, isEvenGroup, isPrivateCode with
        | DELIMITER, _, _                   -> name
        | _, true, _                        -> name
        | _, false, true                    -> PRIVATE_CREATOR_TAG
        | _, false, false                   -> UNKNOWN_TAG